import React from 'react';
import '../App.css';

function Box({ id }) {
  const backgroundImage = id === 'box1' ? 'img/grill.png' : 'img/grill.png';

  return (
    <div className="box" id={id} style={{ backgroundImage: `url(${backgroundImage})` }}>
      {id === 'box1' && (
        <div className="scroll1">
          <img src="img/1.png" alt="Top Scroll Image" />
          <div className="scroll-handle"></div>
          <img src="img/2.png" alt="Bottom Scroll Image" />
        </div>
      )}
    </div>
  );
}

export default Box;
